package com.example.demo.entity;

import java.util.HashSet;
import java.util.Set;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.context.event.ApplicationReadyEvent;
import org.springframework.context.event.EventListener;
import org.springframework.stereotype.Component;
import org.springframework.transaction.annotation.Transactional;

import com.example.demo.repository.AccountRepository;
import com.example.demo.repository.ProductRepository;

@Component
public class AddingSampleData {

    @Autowired
    private ProductRepository productRepository;
    
    @Autowired
    private AccountRepository accountRepository;

    @EventListener
    @Transactional
    public void appReady(ApplicationReadyEvent event) {
    	Product product = new Product("Dell 2245", 3000000, 20, "Dell", "Just is short description", "And this is full description");

    	Image image1 = new Image("Dell_1.jpeg", "demo image1", "data:image/jpeg;base64,");
    	Image image2 = new Image("Dell_2.jpeg", "demo image1", "data:image/jpeg;base64,");
    	
    	image1.setProduct(product);
    	image2.setProduct(product);

    	Set<Image> images = new HashSet<Image>();
    	images.add(image1);
    	images.add(image2);
    	
    	product.setImages(images);
    	productRepository.save(product);
    	
    	Account account = new Account("Nguyen Trung Phi");
    	accountRepository.save(account);
    }
}